import logo from "./logo.svg";
import "./App.css";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  HashRouter,
  useParams,
  Link
} from "react-router-dom";
import Header from "./components/header/header.jsx";
import EventCard from "./components/events/card.jsx";
import EventShow from "./components/events/show.jsx";
import ProfileCard from "./components/profiles/card.jsx";
import ActiveRoomCard from "./components/rooms/card.jsx";
import ProgressCard from "./components/attendances/progress.jsx";

function App() {
  return (
    <body className="antialiased">
      <div className="wrapper">
        <Header />
        <div className="page-wrapper">
          <div className="container-xl">
            <div className="page-header d-print-none">
              <div className="row align-items-center"></div>
              <div className="col">
                <div className="page-pretitle">Overview</div>
                <h2 className="page-title">Condensed dark layout</h2>
              </div>
            </div>
          </div>
          <div className="page-body">
            <div className="container-xl">
              <div className="row row-deck row-cards">
                <EventCard />
                <ProfileCard />
                <ActiveRoomCard />
                <ProgressCard />
              </div>
            </div>
          </div>
        </div>
      </div>
      <HashRouter >
      <Switch >
        <Route path="/events/:id" exact component={EventShow} />

      </Switch>
      </HashRouter>
    </body>
  );
}

export default App;
